import React, { Fragment } from "react";
import { Typography, Badge } from "antd";
const { Text } = Typography;

const HeaderTitle = ({ title }) => {
  return (
    <Fragment>
      <div style={{ textAlign: "center" }}>
        <Text strong style={{ fontSize: "50px" }}>
          {title}
        </Text>
      </div>
    </Fragment>
  );
};

export default HeaderTitle;
